import styled from 'styled-components';

export const LinkingWrapper = styled.div`
ul {
    text-decoration: none;
    list-style-type:none;
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 0;
}
li {
    text-decoration: none;
    display: inline-block;
    padding: 5px 5px 10px 5px;
    position: relative;
    font-weight: bold;
    margin: 10px 30px;
    font-size: 24px;
    font-weight: 100;
    a {
        color: black;
    }
}
`
